import React from 'react';
import './style.scss'


const Skills = ({ style }) => {
    return (
        <div className='skills-page' style={style}>
            <div className='title-page'>SOFT SKILLS</div>
            <div>
                <div>Teamwork <BiCheckCircle/></div>
                <div>Responsibility</div>
                <div>Relocation</div>
                <div>Confidence</div>
                <div>Flexibility and creativity</div>
            </div>

        </div>
    );
};

export default Skills;
